const commits = []

export function commitScraper () {
    
    
     fetch ("https://api.github.com/repos/BrightNate1022/git_scrap")
    .then (response => response.json())
    // .then (console.log (response))
     
    .then (data => commits.push(data.commits_url))
    // .then (data => console.log(data.commits_url))
    console.log(commits)
 
    
}
export default commits
